import { View, Text, ScrollView, TouchableOpacity, useWindowDimensions, StatusBar, BackHandler } from 'react-native';
import HTML from 'react-native-render-html';
import AntDesign from 'react-native-vector-icons/AntDesign';
// import PinchZoomView from 'react-native-pinch-zoom-view';
import { green } from '../utils/colors';
import { responsiveFontSize } from 'react-native-responsive-dimensions';
import { useFocusEffect } from '@react-navigation/native';
import { useCallback } from 'react';
import RNHTMLtoPDF from 'react-native-html-to-pdf';
import Share from 'react-native-share';

const Invoice = ({ navigation, route }) => {

    const { data } = route?.params;
    // console.log('quotationDetails: ', data);

    const { width } = useWindowDimensions();

    const today = new Date();
    const day = String(today.getDate()).padStart(2, '0'); // Get day and pad with 0 if needed
    const month = String(today.getMonth() + 1).padStart(2, '0'); // Months are 0-indexed, so add 1
    const year = today.getFullYear();

    const formattedDate = `${day}/${month}/${year}`;

    // Custom Back Action
    const handleBackPress = useCallback(() => {
        navigation.reset({
            index: 0,
            routes: [{ name: 'Quotation' }], // Replace with your desired screen
        });

        return true; // Return `true` to prevent the default back behavior
    }, [navigation]);

    // Use Focus Effect to attach and detach back handler
    useFocusEffect(
        useCallback(() => {
            // Add Back Handler
            const backHandler = BackHandler.addEventListener(
                'hardwareBackPress',
                handleBackPress
            );

            // Cleanup on unmount or blur
            return () => backHandler.remove();
        }, [handleBackPress])
    );

    const generateProductRows = (productDataArray) => {
        return productDataArray
            .map((product, index) => `
                <div style="display: flex; flex-direction: row; ">
                    <div style="width: 10%; border: 1px solid black; text-align: center; padding: 8px; color: #000; fontSize: 11px;">
                        ${index + 1}
                    </div>
                    
                    <div style="width: 25%; border: 1px solid black; text-align: center; padding: 8px; color: #000; fontSize: 11px;">
                        ${product?.productType || ''}
                    </div>
                    
                    ${product?.sizeType === 'Bag' ? `
                        <div style="width: 45%; border: 1px solid black; text-align: center; padding: 5px; color: #000; fontSize: 11px;">
                            ${product?.bagSize || ''} KG Bag
                        </div>
                    `: `
                        <div style="width: 45%; border: 1px solid black; text-align: center; padding: 5px; color: #000; fontSize: 11px;">
                            ${product?.sizeType || ''}, ${product?.length || ''} x ${product?.height || ''} x ${product?.thickness || ''}
                        </div>
                    `}

                    ${product?.sizeType === 'Bag' ? `
                        <div style="width: 20%; border: 1px solid black; text-align: center; padding: 2px; color: #000; fontSize: 11px;">
                           Rate/Bag (₹ ${product?.ratePerBag || ''}/-)
                        </div>
                    `: `
                        <div style="width: 20%; border: 1px solid black; text-align: center; padding: 2px; color: #000; fontSize: 11px;">
                           Rate/Cu.M (₹ ${product?.customRate || ''}/-)
                        </div>
                    `}
                </div>
            `)
            .join('');
    };

    const htmlContent = `
    <!DOCTYPE html>
        <html>
        <head>
            <meta name="viewport" content="width=device-width, initial-scale=1.0, maximum-scale=3.0, user-scalable=yes">
            <style>
                html{
                    padding: 0;
                    margin: 0;
                }
                body {
                    color: black;
                    background-color: white;
                    font-family: Arial, sans-serif;
                    font-size: 12px;
                }
                .table {
                    border-collapse: collapse;
                    margin: 20px 0;
                }
                .table th, .table td {
                    border: 1px solid black;
                    padding: 5px;
                    text-align: left;
                }
                .table th {
                    background-color: #f2f2f2;
                }
                .footer-image {
                    text-align: center;
                    margin-top: 30px;
                    flex-direction: row;
                    justify-content: space-between;
                    align-items: center;
                }
                .footer-image img {
                    max-width: 150px;
                    height: auto;
                }
            </style>
        </head>

        <body style="margin: 0; padding: 8px; width: ${width}; box-sizing: border-box;">
            <div class="header" style="text-align: center; margin-bottom: 20px;">
                <h1 style="font-size: 12px; color: white; font-weight: bold; background-color: green;">QUOTATION FOR ${data?.address_type?.title} (FOR)</h1>
                <h2 style="text-align: center; font-size: 12px; color: black; font-weight: bold; background-color: yellow; text-transform: uppercase; ">
                    NAME OF THE COMPANY FROM WHICH BILLING SHOULD BE DONE: ${data?.company_name}
                </h2>
            </div>

            <div style="color: black;">
                <p style="font-size: 12px; font-weight: bold; margin: 0px;">To:</p>
                <p style="font-size: 12px; margin: 1px; font-weight: bold;">DATED - ${formattedDate}</p>
                <p style="margin: 1px; font-size: 12px; ">${data?.company_name}</p>
                <p style="margin: 1px; font-size: 12px; ">Address: ${data?.apiData?.client_address}</p>
                <p style="margin: 1px; font-size: 12px; ">${data?.apiData?.project_name} & LOCATION</p>
                <p style="margin: 1px; font-size: 12px; ">Kind Attention Mr/Ms. <span class="highlight" style="font-weight: bold;">${data?.apiData?.client_name}</span> (${data?.apiData?.client_mobile} & Email)</p>
            </div>

            <h3 style="text-decoration: underline; text-align: center; margin: 20px auto; font-size: 11px; width: 93%; color: black;">Sub: Offer for supply of AAC Blocks & Fix-O-Block for your location at ${data?.address_type?.title}</h3>

            <h6 style="text-decoration: underline; text-align: center; margin: 10px auto; font-size: 10px; width: 93%; color: black;">This has reference to your discussion with our management on the above subject; we are giving you here below the best offer for the subjected material</h6>

            <!-- Table Container -->
            <div style="border: 1px solid black; font-size: 14px; font-family: Arial, sans-serif;">
                <div style="display: flex; flex-direction: row; background-color: #f0f0f0; font-weight: bold; border-bottom: 1px solid black;">
                    <div style="width: 10%; border: 1px solid black; text-align: center; padding: 5px; color: black; font-size: 12px;">
                        Sl No
                    </div>

                    <div style="width: 25%; border: 1px solid black; text-align: center; padding: 5px; color: black; font-size: 12px;">
                        Item description
                    </div>

                    <div style="width: 45%; border: 1px solid black; text-align: center; padding: 5px; color: black; font-size: 12px;">
                        Size in mm
                    </div>

                    <div style="width: 20%; border: 1px solid black; text-align: center; padding: 5px; color: black; font-size: 12px;">
                        Rate
                    </div>
                </div>

                ${generateProductRows(data?.products)}
            </div>

            <!-- Terms & Conditions -->
            <div style="margin-top: 20px;">
                <h3 style="font-size: 12px; color: black; text-decoration: underline; margin: 0;">Commercial Terms & Conditions:</h3>
                <div style="font-size: 12px; color: black; margin-top: 10px; margin-left: 15px;">
                    <div style="margin-bottom: 5px;">
                        <span>The above price is for ${data?.address_type?.title}</span>
                    </div>

                    <div style="margin-bottom: 5px;">
                        ${data?.is_unloading === 2 ? `
                            <span>Unloading should be borne and arranged by your end.</span>
                        `: `
                            <span>Rate inclusive of 12% GST on Blocks & 18% GST on Fix-O-Block</span>
                        `}
                    </div>
                    
                    <div style="margin-bottom: 5px;">
                        <span style="background-color: yellow;"Payment: Advance NEFT/RTGS</span>

                        ${data?.payment_mode === 3 ? `
                            <span style="background-color: yellow;">/CREDIT ${data?.credit_days} days</span>
                        `: ``}
                    </div>

                    <div style="margin-bottom: 5px;">
                        ${data?.breakage === 'N/A' ? `
                            <span>No breakage or shortage will be borne by the company. To ascertain the exactness of quantity and quality you may deploy your authorized representative or your driver.</span>
                        `: `
                            <span>Breakage up to ${data?.breakage} of total no. of pieces is within the tolerance limit which is to be borne by you. If in case the breakage is more than ${data?.breakage}, kindly inform us so that we can arrange an inspection from our end and also mention on the receiving duly acknowledged by the driver.</span>
                        `}
                    </div>
                    
                    <div style="margin-bottom: 5px;">
                        <span>Side/Edge chipping will not be considered as breakage</span>
                    </div>

                    <div style="margin-bottom: 5px;">
                        <span>Goods once sold cannot be taken back.</span>
                    </div>

                    <div style="margin-bottom: 5px;">
                        <span>Validity: This quotation is valid till ${data?.validity} days.</span>
                    </div>

                    <div style="margin-bottom: 5px;">
                        <span style="background-color: yellow;">Please give us your schedule of requirement & lifting well in advance.</span>
                    </div>

                    <div style="margin-bottom: 5px;">
                        <span>Detention charges will be charged @₹${data?.detention_charge}/day if the truck is unloaded after 6 hours of its reporting at the site.</span>
                    </div>

                    <div style="margin-bottom: 5px;">
                        <span>Application of AAC BLOCKS have to be as per IS code 6041. We provide Technical Assistance / hand holding which is free of cost. If in case you need any technical assistance you may contact: 7086037724 / 7086037729</span>
                    </div>

                    <div style="margin-bottom: 5px;">
                        <span>Standard Force Majeure Clause Applicable.</span>
                    </div>
                    
                    <div style="margin-bottom: 5px;">
                        <span>Order Quantity should be on Full Truck Basis.</span>
                    </div>

                    ${data?.addl_terms ? `
                        <div style="margin-bottom: 5px;">
                            <span>${data?.addl_terms}</span>
                        </div>
                    `: ``}

                    <div style="margin-bottom: 5px;">
                        <span>Delivery will start in 2-3 days from the date of PO.</span>
                    </div>

                    <div style="margin-bottom: 5px; background-color: yellow;">
                        <span>Loading & unloading at the site to be arranged and borne by you.</span>
                    </div>

                    <div style="margin-bottom: 5px; background-color: yellow;">
                        <span>Short Quantity might be on Full Truck Basis.</span>
                    </div>
                    
                    <div style="margin-bottom: 5px;">
                        <span>Purchase Order should be raised in the following:</span>

                        ${data.pad_type === 1 ? `
                            <div style="flex-direction: column; justify-content: center;">
                                <p style="margin: 0">EVERGREEN BLOCKS AND SOLUTIONS</p>
                                <p style="margin: 0">CNF Agent of Superlite AAC Blocks Industry</p>
                                <p style="margin: 0">GSTIN : 18AAKFE6817H1Z6</p>
                                <p style="margin: 0">Warehouse : Sarutari, 14th Mile, Sonapur, P.O- Byrnihat, Pin - 782402 (Assam)</p>
                            </div>
                        ` : data.pad_type === 2 ? `
                            <div style="flex-direction: column; justify-content: center;">
                                <p style="margin: 0">SUPERLITE AAC BLOCKS INDUSTRY</p>
                                <p style="margin: 0">GSTIN : 18ACLFS1143H1Z2</p>
                                <p style="margin: 0">Manufacturing Unit : Sarutari, 14th Mile, Sonapur, P.O- Byrnihat, Pin - 782402 (Assam)</p>
                            </div>
                        ` : `
                            <div style="flex-direction: column; justify-content: center;">
                                <p style="margin: 0">SUPERLITE SOLUTIONS</p>
                                <p style="margin: 0">(A unit of SUPERLITE AAC BLOCKS INDUSTRY)</p>
                                <p style="margin: 0">GSTIN : 18ACLFS1143H4ZZ</p>
                                <p style="margin: 0">Manufacturing Unit : Sarutari, 14th Mile, Sonapur, P.O- Byrnihat, Pin - 782402 (Assam)</p>
                            </div>
                        `}
                    </div>

                    <div style="margin-bottom: 5px; flex-direction: column; justify-content: center;">
                        <p style="margin: 0;">Our Bank Details:</p>
                        <p style="margin: 0;">${data?.bank_details?.name}</p>
                    </div>
                </div>
            </div>

            <p style="font-size: 12px; color: black; margin-top: 20px;">Thanking You</p>

            <p style="color: black; margin-top: 10px; fontSize: 13px; fontWeight: bold;">Name of Designaion/Executive/Phone Number</p>

            <div class="footer-image">
                <img style="marginTop: 30px; marginRight: 5px;" src="data:image/png;base64," alt="Company Seal">
               
                <img style="marginTop: 10px; marginRight: 5px;" src="data:image/png;base64," alt="Company Seal">

                <img style="marginTop: 10px; marginRight: 5px;" src="data:image/png;base64," alt="Company Seal">
            </div>

            </body>
        </html>
    `;

    // Generate Quotation
    const generateQuotation = async () => {
        try {
            // Generate PDF
            const pdfOptions = {
                html: htmlContent,
                fileName: 'Teamsuper_Quotation',
                directory: 'Documents',
            };

            const pdf = await RNHTMLtoPDF.convert(pdfOptions);
            const pdfPath = pdf.filePath;

            // Share the PDF
            const shareOptions = {
                title: 'Share Invoice',
                url: `file://${pdfPath}`,
                type: 'application/pdf',
                saveToFiles: true,
            };

            await Share.open(shareOptions);
        } catch (error) {
            console.log(error.message);
        }
    };

    return (
        <View style={{ flex: 1, backgroundColor: "#f2f2f2", flexDirection: "column", paddingHorizontal: 10 }}>
            <StatusBar
                animated={true}
                backgroundColor="#f2f2f2"
                barStyle="dark-content"
            />

            {/* Header */}
            <View style={{ marginTop: 10, flexDirection: 'row', justifyContent: 'space-between', alignItems: 'center', marginBottom: 20, width: '100%' }}>
                <TouchableOpacity style={{ borderRadius: 8, flexDirection: 'row', justifyContent: 'center', alignItems: 'center', width: 30, height: 30, backgroundColor: '#daeecf', borderColor: green, borderWidth: 1 }} onPress={() => navigation.navigate('Quotation')}>
                    <AntDesign name="arrowleft" style={{ color: '#000' }} size={16} />
                </TouchableOpacity>

                <View style={{ width: '80%' }}>
                    <Text style={{ fontSize: responsiveFontSize(2.3), fontWeight: '700', color: '#000', textAlign: 'center' }}>Quotation</Text>
                </View>

                <TouchableOpacity style={{ borderRadius: 8, flexDirection: 'row', justifyContent: 'center', alignItems: 'center', width: 30, height: 30, backgroundColor: '#daeecf', borderColor: green, borderWidth: 1 }} onPress={generateQuotation}>
                    <AntDesign name="sharealt" style={{ color: '#000' }} size={16} />
                </TouchableOpacity>
            </View>

            {/* Quotation Content */}
            <ScrollView>
                <View style={{ paddingBottom: 10, marginBottom: 50, backgroundColor: '#fff' }}>
                    <HTML source={{ html: htmlContent }} />
                </View>
            </ScrollView>
        </View>
    );
};

export default Invoice;